import React from 'react'

const Login = () => {
    return <h2>Login Component</h2>

    const loginObject = {
        method: 'POST',
        body: JSON.stringify({email: 'acapp909@gmail.com', password: '1234'})
    }

    fetch('https://localhost:3000/login', loginObject)
        .then(resp => resp.json())
        .then(json => {
            console.log('userlogin response: ', json)
            return json
        })
}

export default Login
